public class IsSubsequence {

    public static void main(String[] args) {
        System.out.println(isSubsequence("leeeeetcode"
              ,
                                         ""));
    }

    public static boolean isSubsequence(String s, String t) {
        int tPointer = 0;

        for (int i = 0; i < s.length(); i++) {
            char c = s.charAt(i);
            while (tPointer < t.length() && t.charAt(tPointer) != c) {
                tPointer++;
            }

            if (tPointer >= t.length() || t.charAt(tPointer) != c) {
                return false;
            }

            System.out.println(tPointer);
            System.out.println(t.charAt(tPointer));
        }

        return true;
    }
}
